<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <link rel="stylesheet" href="globals.css" />
    <link rel="stylesheet" href="iPhone 16 Pro Max - 9.css" />
  </head>
  <body>
    <div class="iphone-pro-max">
      <div class="overlap-wrapper">
        <div class="overlap">
          <img class="arrow-icon-sign" src="img/arrow-icon-sign-symbol-design-free-png-1.png" />
          <div class="overlap-group">
            <div class="progress">Progress</div>
            <div class="rectangle"></div>
            <div class="div"></div>
            <div class="rectangle-2"></div>
            <img class="img" src="img/image.png" />
            <img class="rectangle-3" src="img/rectangle-11.png" />
            <img class="rectangle-4" src="img/rectangle-22.png" />
            <div class="japanese">Japanese</div>
            <img class="navigation-menu" src="img/navigation-menu-1-streamline-ultimate.svg" />
            <div class="german">German</div>
            <div class="hindi">Hindi</div>
            <div class="level-basic">Level 1 Basic</div>
            <div class="completion">Completion - 61%</div>
            <div class="text-wrapper">Completion - 91%</div>
            <div class="completion-2">Completion - 79%</div>
            <div class="level-travel">Level 2 Travel</div>
            <div class="level-business">Level 4 Business</div>
            <img class="OIP" src="img/OIP-6-1.png" />
            <img class="OIP-2" src="img/OIP-6-2.png" />
            <img class="OIP-3" src="img/OIP-6-3.png" />
            <div class="rectangle-5"></div>
            <div class="rectangle-6"></div>
            <div class="home">Home</div>
            <div class="home-streamline">
              <img class="home-door-entrance" src="img/home-2-door-entrance-home-house-roof-round-shelter.png" />
            </div>
            <div class="rectangle-7"></div>
            <div class="badges">Badges</div>
            <div class="star-badge"></div>
            <div class="rectangle-8"></div>
            <div class="progress-2">Progress</div>
            <div class="decent-work-and">
              <img class="decent-work-and-2" src="img/decent-work-and-economic-growth.png" />
            </div>
            <div class="rectangle-9"></div>
            <div class="games">Games</div>
            <div class="keyboard-streamline">
              <img class="keyboard-keyboard" src="img/keyboard-keyboard-device-electronics-dvorak-qwerty.png" />
            </div>
            <div class="rectangle-10"></div>
            <div class="profile">Profile</div>
            <div class="user-circle-single"></div>
          </div>
        </div>
      </div>
    </div>
  </body>
</html>
